import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
<div className="row">
    <div className="container">
        <Head>
            <title>Bitsprice</title>
         
        
        </Head>

        <Navbar/>

        {props.children}

    </div>
</div>
);


export default Layout;
